script: |
  super -f text -I q5549.spq | sort > q5549.out

inputs:
  - name: q5549.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 + + - ( + - col2 ) BETWEEN + + 50 AND - col2 * + 28;
  - name: tab1

outputs:
  - name: q5549.out
    data: |
      51	14	96
      85	5	59
      91	47	68
